INSERT INTO `artist` VALUES ('Paris, France','Paris, France','4d8b925d4eb68a1b2c000012','Georges Seurat','','georges-seurat','null','null','https://d32dm0rphc51dk.cloudfront.net/TZrH8xDtvJmjfij5s8zEkA/four_thirds.jpg','null','French'),('Connecticut, Massachusetts, and New York','Colebrook, CT, USA','4d8b925e4eb68a1b2c000030','Ammi Phillips','null','ammi-phillips','null','null','https://d32dm0rphc51dk.cloudfront.net/4JUK6idXaJ-ICejprbLxhQ/four_thirds.jpg','null','American'),('New York and West Granby, Connecticut','Francestown, NH, USA','4d8b925e4eb68a1b2c000038','Aaron Draper Shattuck','null','aaron-draper-shattuck','null','null','https://d32dm0rphc51dk.cloudfront.net/_zJ9I5WaCNi2o8THB5U4zA/four_thirds.jpg','null','American'),('Arkville, New York and Keene Valley, New York','Port Washington, OH, USA','4d8b925f4eb68a1b2c000046','Alexander Helwig Wyant','','alexander-helwig-wyant','null','null','https://d32dm0rphc51dk.cloudfront.net/O8xNXT5wdNI2UuxcQDabmA/four_thirds.jpg','null','American'),('Rome, Italy and Naples, Italy','Caravaggio, Italy','4d8b92624eb68a1b2c000066','Michelangelo Merisi da Caravaggio','','michelangelo-merisi-da-caravaggio','null','null','https://d32dm0rphc51dk.cloudfront.net/4z6Ljl5oS506sk_0ZbOq6w/four_thirds.jpg','null','Italian'),('Paris and Aix-en-Provence, France','Aix-en-Provence, France','4d8b92624eb68a1b2c00006c','Paul Cézanne','Paul Cézanne (19 January 1839  22 October 1906) was a French artist and Post-Impressionist painter whose work laid the foundations of the transition from the 19th century conception of artistic endeavor to a new and radically different world of art in the 20th century. Cézanne can be said to form the bridge between late 19th century Impressionism and the early 20th century\'s new line of artistic enquiry, Cubism. The line attributed to both Matisse and Picasso that Cézanne \"is the father of us all\" cannot be easily dismissed. Cézanne\'s work demonstrates a mastery of design, colour, composition and draftsmanship. His often repetitive, sensitive and exploratory brushstrokes are highly characteristic and clearly recognizable. He used planes of colour and small brushstrokes that build up to form complex fields, at once both a direct expression of the sensations of the observing eye and an abstraction from observed nature. The paintings convey Cézanne\'s intense study of his subjects, a searching gaze and a dogged struggle to deal with the complexity of human visual perception.','paul-cezanne','null','null','https://d32dm0rphc51dk.cloudfront.net/Q7dKvB7AKUMnziCM_CSmtQ/four_thirds.jpg','null','French'),('Clos Lucé, Amboise, France','Anchiano, Italy','4d8b92684eb68a1b2c00009e','Leonardo da Vinci','','leonardo-da-vinci','null','null','https://d32dm0rphc51dk.cloudfront.net/s-MV9TavBK6JDW8TGe-Dew/four_thirds.jpg','null','Italian'),('Moscow, Russia','Kiev, Ukraine','4d8b92694eb68a1b2c0000ac','Kasimir Severinovich Malevich','','kasimir-severinovich-malevich','null','null','https://d32dm0rphc51dk.cloudfront.net/Pwq2eoTMbl_vINVj2ooM3A/four_thirds.jpg','null','Russian'),('London, UK','Leicester, UK','4d8b92704eb68a1b2c0000e0','Richard Caldicott','','richard-caldicott','null','null','https://d32dm0rphc51dk.cloudfront.net/d2yu2nABWDBTUSrsFFa7Dg/four_thirds.jpg','null','British'),('Neuilly-sur-Seine, France','Moscow, Russia','4d8b92774eb68a1b2c00012e','Wassily Kandinsky','','wassily-kandinsky','null','null','https://d32dm0rphc51dk.cloudfront.net/-biSpkdpnHtjCKo_mDRCNQ/four_thirds.jpg','null','Russian'),('Giverny, France','Paris, France','4d8b92774eb68a1b2c000134','Claude Monet','Claude Monet, born Oscar Claude Monet (14 November 1840  5 December 1926) was a founder of French impressionist painting, and the most consistent and prolific practitioner of the movement\'s philosophy of expressing one\'s perceptions before nature, especially as applied to plein-airlandscape painting. The term Impressionism is derived from the title of his painting Impression, Sunrise (Impression, soleil levant).','claude-monet','null','null','https://d32dm0rphc51dk.cloudfront.net/95EYpbkhcWsEKG18njyhCw/four_thirds.jpg','null','French'),('Atuona, French Polynesia','Paris, France','4d8b927c4eb68a1b2c00015a','Paul Gauguin','','paul-gauguin','null','null','https://d32dm0rphc51dk.cloudfront.net/jsaOG8cOknnRajFUmbnn9g/four_thirds.jpg','null','French'),('Paris, France','Paris, France','4d8b927e4eb68a1b2c000168','Édouard Manet','','edouard-manet','null','null','https://d32dm0rphc51dk.cloudfront.net/r0sxPCAkXuSt8L1N4156Aw/four_thirds.jpg','null','French'),('Florence, Italy','Caprese Michelangelo, Italy','4d8b92834eb68a1b2c00019e','Michelangelo Buonarroti','','michelangelo-buonarroti','null','null','https://d32dm0rphc51dk.cloudfront.net/bjSbQqqhTKoSlUxgeUcskg/four_thirds.jpg','null','Italian'),('Vienna, Austria','Tulln an der Donau, Austria','4d8b92834eb68a1b2c0001a0','Egon Schiele','','egon-schiele','null','null','https://d32dm0rphc51dk.cloudfront.net/KoTOfdDcFB5djqXOjIKjNw/four_thirds.jpg','null','Austrian'),('Venice, Italy','Pieve di Cadore, Italy','4d8b92884eb68a1b2c0001d4','Titian','','titian','null','null','https://d32dm0rphc51dk.cloudfront.net/2wt3SZwbQxHSq0YRCT0ReQ/four_thirds.jpg','null','Italian'),('Antwerp, Netherlands','Siegen, Westphalia','4d8b92884eb68a1b2c0001dc','Peter Paul Rubens','','peter-paul-rubens','null','null','https://d32dm0rphc51dk.cloudfront.net/kEmtynKqwyfJh8Z04fV2YQ/four_thirds.jpg','null','Flemish'),('Paris, France and London, UK','Florence, Italy','4d8b928a4eb68a1b2c0001e8','John Singer Sargent','The most sought-after society portraitist of his time, as well as a highly accomplished painter of landscapes and genre scenes, Sargent was born in Florence to well-to-do American parents. The French-trained Sargent depicted his sitters with a bravura brushstroke and a degree of originality that were highly progressive at the time. As a result, he enjoyed critical notice and important patronage, but also weathered some controversy. Though he spent most of his life abroad, his American ties brought him numerous portrait commissions as well as important commissions for the mural programs at Boston\'s Museum of Fine Arts and the Boston Public Library. \n\nSargent\'s works, whether in oil, watercolor, or charcoal, are marked with naturalness and a distinct sense of immediacy due to his remarkable technical facility as an artist. Whether monumental portraits or casual outdoor scenes, his works possess a freshness and fluidity seldom matched in any era. Sargent spent much of his free time painting and sketching outdoors, and his landscapes and outdoor genre scenes -- influenced by his friendship with Claude Monet and frequently executed in watercolor -- depict the various locations he visited, including Italy, rural England, Giverny, the Mediterranean, northern Africa, and the Alps. The artist devoted a large portion of his late career to his mural projects, and also served as a war artist during World War I.','john-singer-sargent','null','null','https://d32dm0rphc51dk.cloudfront.net/BWSu3vf0xliBCpYAsc6Rqw/four_thirds.jpg','null','American'),('Paris, France','Madrid, Spain','4d8b928e4eb68a1b2c000222','Juan Gris','','juan-gris','null','null','https://d32dm0rphc51dk.cloudfront.net/wGMxL6TvlSORJzEHZsK9JA/four_thirds.jpg','null','Spanish'),('Arles, France, Saint-Rémy, France and Auvers-sur-Oise, France','Zundert, Netherlands','4d8b92944eb68a1b2c000264','Vincent van Gogh','','vincent-van-gogh','null','null','https://d32dm0rphc51dk.cloudfront.net/wMhDVMZP68ERKRVE_c1k-g/four_thirds.jpg','null','Dutch'),('New York, NY, USA','Columbus, OH, USA','4d8b92954eb68a1b2c000274','George Bellows','Linked with the urban realists of the Ashcan school, Bellows gained renown for his direct and unsentimental portrayals of early twentieth-century city life. The Columbus, Ohio-born artist played semi-pro baseball before moving to New York, and his lifelong fascination with athletics led him to explore the then illicit world of prizefighting, capturing on canvas the rawness and excitement of the often brutal confrontations. Bellows also painted portraits of friends and family members, as well as seascapes and landscapes, particularly of the rugged Maine coast and the area around Woodstock, New York, where he spent summers after 1920. \n\nOne of the few American artists of his era who did not study abroad, Bellows attended classes at the Art Students League of New York with Robert Henri. In addition to his oil painting, he worked as an illustrator to supplement his income, and began to produce lithographs after 1916. Though trained in America, he was keenly interested in European art, and had a hand in the organization of the groundbreaking 1913 Armory Show. Bellows\' unsentimental early portrayals of boxers and tenement dwellers are executed in a loose, impressionistic painting style, using bold brushstrokes and a subdued palette. His later works reveal the influence of modern theories of color and composition in which he immersed himself before his untimely death from complications of appendicitis at the height of his career.','george-bellows','null','null','https://d32dm0rphc51dk.cloudfront.net/OkpW427w37Sx9VxHXzqdoQ/four_thirds.jpg','null','American'),('Ellsworth, ME, USA','Lewiston, ME, United States','4d8b92964eb68a1b2c00027e','Marsden Hartley','A pioneering modernist painter who was part of the circle of artists around legendary dealer Alfred Stieglitz, Hartley painted landscapes, portraits, and still lifes imbued with a spiritual expressiveness. Whether treating the mysticism of Native American cultures, the hardiness of rural Maine, or the military pageantry of pre-World War I Germany, Hartley\'s works encompass the defining nature of his subjects, and seek to represent much more than observed reality. Hartley possessed a deep attachment to nature, and for him, a Maine landscape was not simply a picturesque view, but rather something evoking the profound geologic power as well as the poetic isolation of the state where he was born. \n\nHartley, who worked primarily in oil, also produced a number of pastels over the course of his career, and for a brief period, he experimented with painting on glass. Although rooted in reality, Hartley\'s works selectively emphasize certain visual elements of a scene, endowing them with a monumentality that reflects what he saw as their spiritual and symbolic nature. This effect is often heightened by his use of strongly outlined forms and flattened space. His variety of subjects look back upon the many places he lived and visited during his peripatetic life -- Maine, Paris, Germany, Mexico, New York, New Mexico, New Hampshire, Cape Cod, Gloucester, Nova Scotia, Bermuda, and the south of France among them.','marsden-hartley','null','null','https://d32dm0rphc51dk.cloudfront.net/qx14_-bzomniTo1-iuF3xg/four_thirds.jpg','null','American'),('New York and East Hampton, NY, USA and Paris, France','Dorchester, MA, United States','4d8b92964eb68a1b2c000280','Childe Hassam','One of the most celebrated and well-known of the American impressionists, Hassam created works documenting his wide travels and his inclination toward the picturesque and agreeable aspects of the world around him. He worked as an illustrator early in his career, and the sharp eye he developed in that occupation encouraged him to seek out the pictorial possibilities wherever he went, from the streets of Paris to the shipyards of New England to the deserts of eastern Oregon. His series of flag paintings, which depict the parades proceeding up New York\'s Fifth Avenue during World War I, are some of the most iconic images in American art. \n\nHassam combined his intense interest in the effects of light as well as the animated brushwork and vivid color (after the mid-1880s) that typify impressionist painting with a more substantial use of forms and volumes to arrive at his signature style. His works flicker with color and light, but retain a sense of solidity and recognizable space. Whether executed in watercolor, oil or pastel, Hassam\'s lively landscape scenes capture the scenic appeal of places including Appledore, Cos Cob, Old Lyme, and East Hampton, (where he spent summers); the streets of New York and Paris; and the countryside of Normandy and Brittany. A founding member of the Ten American Painters, Hassam also painted nudes and figural works, including a series of window compositions that combined still-life elements and female figures in interiors silhouetted against views of the New York skyline. The artist\'s great ingenuity led him to take up etching at age 55, where he concentrated particularly on architectural subjects.','childe-hassam','null','null','https://d32dm0rphc51dk.cloudfront.net/c51YGpOMfurO80T_sLWtZQ/four_thirds.jpg','null','American'),('New York, NY, USA','Cincinnati, OH, USA','4d8b92964eb68a1b2c000284','Robert Henri','A highly influential painter and teacher, Henri championed urban realism and is viewed as the leader of The Eight and the Ashcan School. The Cincinnati-born Henri studied at the Pennsylvania Academy of the Fine Arts and in Europe before establishing himself in New York. Although highly successful, he chafed at the conservative nature of the city\'s art establishment, and created controversy when in 1908 he helped to organize and participated in an independent exhibition with a group of artists who together would come to be known as The Eight. This group (the core of the so-called Ashcan School) broke new ground in their choice of subject matter, focusing on scenes of everyday urban life in New York, without overlooking its grittier side. \n\nHenri painted landscapes and city scenes, although he concentrated primarily on portraiture and figural work. He depicted all sorts of individuals, from street urchins to exotic foreigners to elegant young women. In choosing subjects regardless of their race or economic status, he democratized a genre of painting that had traditionally focused on the upper classes. Henri\'s work is characterized by bold, slashing brushstrokes and generous application of paint. He progressively incorporated more color into his palette, particularly after 1909, when he became interested in color theory. He also worked frequently in pastel over the course of his career.','robert-henri','null','null','https://d32dm0rphc51dk.cloudfront.net/4sOuUkhKu6K1J0B20nI7AQ/four_thirds.jpg','null','American'),('New York, NY and Prouts Neck, ME, USA','Boston, MA, USA','4d8b92964eb68a1b2c000288','Winslow Homer','One of the most universally acclaimed realist painters America has produced, Homer is particularly known for his scenes of outdoor life. The Boston-born artist began his career as an illustrator for Harper\'s (after an apprenticeship in lithography), reporting pictorially from the Civil War battlefront. The war and its aftermath became a source of imagery for him as he began to concentrate on oil painting, making his first visit to Europe in late 1866, and achieving rapid critical success. While summering in Gloucester, Massachusetts, in 1873, Homer first began to paint seriously in watercolor; it would eventually become his primary medium, allowing him to explore nuances of light, color, and composition in a fluid and spontaneous manner. \n\nHomer\'s outdoor genre scenes encompassed a variety of subjects, including children and young adults (often in summertime leisure pursuits), wilderness guides, and rural blacks in the post-Civil War era. In 1881, he spent almost two years in the fishing village of Cullercoats, on the coast of England, depicting local residents in their daily activities. Increasingly, Homer began painting the sea, and the struggle between man and the wilder side of nature became a dominant theme for him as he moved permanently to Prout\'s Neck, a high, rocky, secluded spot on Maine\'s Atlantic coast. An avid outdoorsman, Homer took annual fishing trips to the Adirondacks, Florida, Bermuda, and the Bahamas, and all of these places provided subject matter for his work. Homer\'s oils are powerfully painted, employing strong contrasts and making full use of the weight and bulk of the oil medium, while his watercolors reveal a lighter, more sensitive touch, capturing his subjects with a fluency and immediacy that influenced generations of artists to come.','winslow-homer','null','null','https://d32dm0rphc51dk.cloudfront.net/FZjpLFnOb2Onqlo5XLC0Rg/four_thirds.jpg','null','American'),('New York, NY, USA','St. John\'s, Newfoundland and Labrador, Canada','4d8b92974eb68a1b2c000298','Maurice Brazil Prendergast','An innovative painter whose work pioneered some of the latest developments in American art, Prendergast is associated with post-Impressionism and considered one of the first American modernists. Although he exhibited with The Eight, most of who were interested in gritty urban realism, Prendergast preferred to depict his subjects in more pleasant and picturesque surroundings. He is particularly known for his cheerful and bright beach and park scenes. The Canadian-born Prendergast moved with his family to Boston at an early age, and traveled abroad a number of times as an adult. Early in his career, he worked primarily in watercolor, but developed a strong interest in oils during the first decade of the 20th century and also produced a large number of monotypes. \n\nPrendergast\'s colorful works are characterized by vivid surface patterning and recurring use of curvilinear forms-often the parasols that provide shade to the park visitors and beachgoers populating his compositions. These flat colored shapes and forms remain as bright in the foreground as they are in the background, lending a highly decorative, almost mosaic-like quality to his works. Prendergast also painted still lifes, and occasionally worked with his brother Charles, a painter and framemaker, on other projects, including designs for the ornamental frames that sometimes accompany his work.','maurice-brazil-prendergast','null','null','https://d32dm0rphc51dk.cloudfront.net/vUaNapr09GcPBHdLD82QSA/four_thirds.jpg','null','Canadian-American'),('Connecticut, USA','West Point, NY, USA','4d8b92984eb68a1b2c00029e','Julian Alden Weir','Born into an artistic family, Weir was a founding member of the Ten American Painters and became one of the most prominent artists of his generation. His father, Robert Weir (an art instructor at the United States Military Academy), provided his early training, and J. Alden initially began painting in an established academic style, refined by later study in New York and Paris. Unlike many of his peers, Weir enjoyed notable success as a painter and teacher before he ever began to work in an impressionist manner. He concentrated on portraits, figural works, and still lifes, and these works exhibit rigorous structure, dramatic use of dark and light, and bold handling of pigment. \n\nAs Weir became increasingly interested in landscape painting after the purchase of his farm in Branchville, Connecticut (now a National Historic Site), he began to work in a more impressionistic mode, encouraged by his experiments in pastel and watercolor, as well as by his friendships with John Twachtman and Theodore Robinson. Weir gradually adopted the looser brushwork of the impressionist style, altering perspective and flattening forms while choosing to work in a softer color palette than that favored by the more radical practitioners of impressionism. His landscape works include scenes of the western Connecticut hills; Cornish, New Hampshire; the factory landscapes of central Connecticut; and the environs of Cos Cob, Connecticut, where he taught a summer painting class.','julian-alden-weir','null','null','https://d32dm0rphc51dk.cloudfront.net/51WlFOIsC0N_idr4zFr7yA/four_thirds.jpg','null','American'),('s-Hertogenbosch, Netherlands','s-Hertogenbosch, Netherlands','4d8b929a4eb68a1b2c0002c0','Hieronymus Bosch','','hieronymus-bosch','null','null','https://d32dm0rphc51dk.cloudfront.net/9n6SwvlRgaEY8cPYM7mGVQ/four_thirds.jpg','null','Dutch'),('Muralto, Switzerland','Münchenbuchsee, Switzerland','4d8b929b4eb68a1b2c0002c8','Paul Klee','','paul-klee','null','null','https://d32dm0rphc51dk.cloudfront.net/VTSBwo2xots6FIJkt9HVvg/four_thirds.jpg','null','German'),('Paris, France','Limoges, France','4d8b929c4eb68a1b2c0002e0','Pierre-Auguste Renoir','','pierre-auguste-renoir','null','null','https://d32dm0rphc51dk.cloudfront.net/3FBfL2Hs7UzA402R3UM2DQ/four_thirds.jpg','null','French'),('Amsterdam and Leiden, Holland','Leiden, Netherlands','4d8b929c4eb68a1b2c0002e2','Rembrandt van Rijn','','rembrandt-van-rijn','null','null','https://d32dm0rphc51dk.cloudfront.net/OFu7ipE_P4uSavBpgKC2VQ/four_thirds.jpg','null','Dutch'),('Delft, Netherlands','Delft, Netherlands','4d8b929e4eb68a1b2c0002f0','Johannes Vermeer','','johannes-vermeer','null','null','https://d32dm0rphc51dk.cloudfront.net/8GwoG1yESI0nmANFD16zqg/four_thirds.jpg','null','Dutch'),('Paris, France','Laval, France','4d8b929f4eb68a1b2c000302','Henri Rousseau','','henri-rousseau','null','null','https://d32dm0rphc51dk.cloudfront.net/q_8c36XPv8GViFU2P1ktAA/four_thirds.jpg','null','French'),('New York, NY and Montclair, NJ, USA','Newburgh, NY, United States','4d8b92a24eb68a1b2c00031a','George Inness','','george-inness','null','null','https://d32dm0rphc51dk.cloudfront.net/WKM2056fW9sAq6Gv7u95YA/four_thirds.jpg','null','American'),('Bruges, Belgium','Maaseik, Belgium','4d8b92a44eb68a1b2c00032e','Jan van Eyck','','jan-van-eyck','null','null','https://d32dm0rphc51dk.cloudfront.net/eFI19ZvA3jRYuEpib3rvNQ/four_thirds.jpg','null','Dutch'),('Oslo, Norway','Løten, Norway','4d8b92aa4eb68a1b2c000378','Edvard Munch','','edvard-munch','null','null','https://d32dm0rphc51dk.cloudfront.net/K6IB0jU56It91wBpXRqwTQ/four_thirds.jpg','null','Norwegian'),('Madrid, Spain','Fuendetodos, Spain','4d8b92b44eb68a1b2c0003fe','Francisco de Goya','','francisco-de-goya','null','null','https://d32dm0rphc51dk.cloudfront.net/rdotrPHi1YqDgOcKDTpsvw/four_thirds.jpg','null','Spanish'),('Vienna, Austria','Baumgarten, Austria','4d8b92b64eb68a1b2c000414','Gustav Klimt','','gustav-klimt','null','null','https://d32dm0rphc51dk.cloudfront.net/n3RTu8EOaXrq3UCBXjh1Ag/four_thirds.jpg','null','Austrian'),('Paris, France','Philadelphia, PA, USA','4d8b92b74eb68a1b2c00041e','Mary Cassatt','One of only three women -- and the only American, woman or man -- invited to exhibit with the Impressionists in Paris, Cassatt spent the majority of her career abroad. In addition to producing her distinctive images of women and children, Cassatt also served as an advisor to important American collectors including Henry and Louisine Havemeyer, whose collection became a cornerstone of New York\'s Metropolitan Museum of Art. The Philadelphia-born Cassatt studied at the Pennsylvania Academy of the Fine Arts before setting off for Europe, where she eventually became a friend and colleague of Edgar Degas. Widely recognized on both sides of the Atlantic and considered one of the greatest living artists of her time, Cassatt was viewed as a truly \"modern\" woman, and she lent her efforts to help American women earn the right to vote. \nCassatt produced her characteristic figurative works in oil and pastel, and was also a highly accomplished printmaker and etcher. She owned a collection of Japanese prints, and the harmonious colors and flattened forms that characterize her style indicate the influence of Japonisme upon her work. She frequently employed friends and family members as her subjects, and the ensuing works explore themes of family, femininity, and daily life.','mary-cassatt','null','null','https://d32dm0rphc51dk.cloudfront.net/ST7tBD1QPZEYaGW8-xJrvw/four_thirds.jpg','null','American'),('Madrid, Spain','Seville, Spain','4d8b92b84eb68a1b2c000424','Diego Velázquez','Diego Rodríguez de Silva y Velázquez (June 6, 1599  August 6, 1660) was a Spanish painter who was the leading artist in the court of King Philip IV. He was an individualistic artist of the contemporary Baroque period, important as a portrait artist. In addition to numerous renditions of scenes of historical and cultural significance, he painted scores of portraits of the Spanish royal family, other notable European figures, and commoners, culminating in the production of his masterpiece Las Meninas (1656). From the first quarter of the nineteenth century, Velázquez\'s artwork was a model for the realist and impressionist painters, in particular Édouard Manet. Since that time, more modern artists, including Spain\'s Pablo Picasso and Salvador Dalí, as well as the Anglo-Irish painter Francis Bacon, have paid tribute to Velázquez by recreating several of his most famous works.','diego-velazquez','null','null','https://d32dm0rphc51dk.cloudfront.net/e5gJxWJvsh5EO7bElRWkqQ/four_thirds.jpg','null','Spanish'),('Florence and Rome, Italy','Vicchio, Italy','4d8b92be4eb68a1b2c000480','Fra Angelico','','fra-angelico','null','null','https://d32dm0rphc51dk.cloudfront.net/IT0vxsjs9Rz9U-a9znohkA/four_thirds.jpg','null','Italian'),('New York, NY, USA','Philadelphia, PA, USA','4d9e2f2f4115b3495a000131','Cecilia Beaux','','cecilia-beaux','null','null','https://d32dm0rphc51dk.cloudfront.net/KUzr5CKZGMZ1R7ikOBa0nQ/large.jpg','null','American'),('New York, NY, USA','Lancaster, PA, USA','4d9e2f424115b3495a00013f','Charles Demuth','null','charles-demuth','null','null','https://d32dm0rphc51dk.cloudfront.net/tAnCt3UiUdT2uR2UgbHfHg/four_thirds.jpg','null','American'),('null','Durham, UK','4d9e3027f9215a26b300018b','John George Brown','null','john-george-brown','null','null','https://d32dm0rphc51dk.cloudfront.net/9Y5ezjFuOnmmM15Mw0WK1Q/four_thirds.jpg','null','American'),('','Lumberville, PA, United States','4d9e307cf9215a26b30001b4','Martin Johnson Heade','','martin-johnson-heade','null','null','https://d32dm0rphc51dk.cloudfront.net/xJbumLZWWHU7AhkMlKctOQ/four_thirds.jpg','null','American'),('New York, NY, USA; South Braintreee, MA, USA','Prenzlau, Germany','4d9e30bbf9215a2